import React, { useEffect, useState } from 'react';

import ExtendedTableRow from '../extendedTableRow';

/**
 * @file module:src/components/ExtendedLine/index.jsx  
 * @param {*} props
 * @param {number} props.index -   
 * @returns 
 */
export default function ExtendedLine(props) {
    const [extend, setExtendTable] = useState(false);

    /**
     * @function module:src/components/ExtendedLine/ExtendedLine~extendtable
     * @summary 
     * @returns 
     */
    function extendtable() {
        setExtendTable(!extend);
    }

    return (
        <>
            <tr onClick={() => extendtable()} style={{ backgroundColor: props.index % 2 === 0 ? "#cfcfcf" : "#fafffb", fontSize: "12px" }}>
                {props.children}
            </tr>
            {
                extend ?
                    <tr>
                        <td onMouseOver={mouseOver} style={{backgroundColor:"#f76060"}} colSpan="100%">
                            <ExtendedTableRow
                                id={props.id}
                                index={props.index}
                                thisUserData= {props.userData[props.index]}
                            />
                        </td>
                    </tr>

                    :
                    null
            }
        </>
    )
};
